CONS = []
PROCS = []

def plugin_loaded():
  for c in constants_raw: CONS.append(('c' + c, c))
  load_procs()

def load_procs():
  args_lbls = procs_raw[0]
  proc_prfxs_lbls = procs_raw[1]
  for i in range(2, len(procs_raw)):
    proc = procs_raw[i]
    name_net = proc[1]
    catgry = proc[0]
    name_full = name_net if catgry == -1 else proc_prfxs_lbls[catgry] + name_net
    name_trgr = 'f' + name_net
    if len(proc) == 3:
      args_inxs = proc[2]
      proc_args = ''
      for i in range(len(args_inxs)) : proc_args += ('${%d:%s}, ' % (i + 1, args_lbls[args_inxs[i]]))
      PROCS.append((name_trgr, 'pdb.' + name_full + '('+ proc_args[:-2] +')'))
    else:
      PROCS.append((name_trgr, 'pdb.' + name_full + '()'))
  PROCS.append(('fregister', 'register(${1:method_name_dashed}, ${2:desc_short}, ${3:desc_long}, ${4:author}, ${5:copyright}, ${6:date}, ${7:image_type}, [${8:parameters}], [${9:returns}], ${10:method_name_underscored}, ${11:menu_path})'))

class GimpAutoCompletePython(sublime_plugin.EventListener):

  def on_query_completions(self, view, prefix, locations):
    if not view.match_selector(locations[0] - len(prefix), 'source.python - string - comment'): return None
    return PROCS if prefix.startswith('f') else CONS if prefix.startswith('c') else None

